				<h2>Top woods</h2>
				<h3>Stika spruce</h3>
				<p>The most important part of an acoustic guitar is its top. The top acts like a speaker. When a string is plucked energy is transferred to the top and the top starts to move. Spruce offers a tight, punchy low end response with great projection. Players who demand a powerful sound with tons of projection will hear the benefit of a Stika spruce top. Used on only the highest quality guitars in the world.</p>
				<h3>Western Red Cedar Top</h3>
				<p>The most important part of an acoustic guitar is its top. The top acts like a speaker. When a string is plucked energy is transferred to the top and the top starts to move. Cedar is softer than spruce, and that softness translates into a sense of sonic warmth. Cedar guitars sound warmer, deeper and slightly richer. Used on only the highest quality acoustics in the world.</p>
