				<h2>Sound box woods</h2>
				<h3>Indian Rosewood</h3>
				<p>One of the most popular and traditional guitar woods of all time. Where mahogany lends itself to the midrange, Rosewoods sonic profile is deeper in the low end. Not to take anything away from Mahogany as many players will find it difficult to tell them apart, but the dedicated ear will notice a deeper, richer, sweeter tone coming from Rosewood guitars.</p>
				<h3>Indian Rosewood</h3>
				<p>One of the most popular tone woods used on acoustic guitars today. if you’re looking for punchy bass, solid mids and sparkling highs mahogany is the wood you want on your next guitar. Acoustic guitars in general tend to live in the midrange portion of the sound spectrum, and mahogany in particular displays this characteristic best. Mahogany’s tendency to emphasize midrange tones gives this guitar a rich full sound no matter the playing style. You can fingerpick, strum or flatpic and mahogany always delivers.</p>
